import React, { Component } from 'react';
import {BrowserRouter, Route, Switch} from 'react-router-dom';
import Register from './views/pages/register/Register';
import Page404 from './views/pages/page404/Page404';
import Login from './views/pages/login/Login';
import TheLayout from './containers/TheLayout';
import './scss/style.scss';
const loading = (
  <div className="pt-3 text-center">
    <div className="sk-spinner sk-spinner-pulse"> </div>
  </div>
)

class App extends Component {
  state = {
    register: []
    // isShowing: false,
    // quizzes: [],
    // questions: [],
    // answerType: 'check-box',
    // emptyQuiz: false,
    // create_question_res: false,
    // delete_type_for_modal: '',
    // updateQuestionRes: '',
    // question: '',
    // answers: []
  }
  render() {
    return (
      <BrowserRouter>
        <Switch>
          <React.Suspense fallback={loading}>
              <Route exact path="/login" name="Login Page" render={props => <Login {...props}/>} />
              <Route exact path="/register" name='Register Page' render={props => <Register
                state={this.state}
                {...props}
              />} />
              <Route path="/admin" name="Home" render={props => <TheLayout {...props}/>} />
              <Route render={props => <Page404 {...props}/>}/>
          </React.Suspense>
        </Switch>
      </BrowserRouter>
    );
  }
}

export default App;
